import React from 'react';

interface cooll {
    amount: number |any,
    description: number |any,
    type: number |any,
    status:any;
}


export  class Review extends React.Component<any,cooll> {

    constructor(props: any) {
        super(props);
        this.state = {
            amount: null,
            description: null,
            type: null,
          status: null,

        }
      }

    setAmount= (pw: any) => {
        this.setState({
          amount: pw.currentTarget.value,
        })
      }
      setDescription = (pw: any) => {
        this.setState({
          description: pw.currentTarget.value,
        })
      }
      setType= (pw: any) => {
        this.setState({
          type: pw.currentTarget.value,
        })
      }

      setStatus= (pw: any) => {
        this.setState({
          type: pw.currentTarget.value,
        })
      }

    render(){
        return(
            <>
            <div key={this.props.access} className="col">
            <span>Reimbursement #  <span>{this.props.id}</span></span>  
            <span>author  <span>{this.props.author}</span></span>  
            <span>amount  <span>{this.props.amount}</span></span>  
            <span>description <span>{this.props.description}</span></span>  
            <span>status <span>{this.props.status}</span></span>  
            <span>type <span>{this.props.type}</span></span>  
            <span>date submitted <span>{this.props.date1}</span></span> 
            <span>date resolved<span> {this.props.date2}</span></span> 
            </div>
            <h4>form here</h4>
            <form onSubmit={this.attemptUpdate}>
        <span className="tag"> New</span>
          {/* <div>
            <input onChange={this.setId} value={this.state.id} type="number" name="id"  
            placeholder="ID (required!)"  required />
          </div> */}
          <div>
          <input onChange={this.setAmount} value={this.state.amount} type="number" name="amount"
           id="amount" placeholder="set amount"
           required/>
            <input onChange={this.setDescription} value={this.state.description} type="text" name="description" 
            placeholder="describe here" autoComplete='false' required />
          </div>

            <div>
            <select onChange={this.setType} name="type" required>
            <option >select type</option>
            <option value="1">Food</option>
            <option value="2">Travel</option>
            <option value="3">Other</option>
            </select>
          </div>

          <div className="notdiv">
            <input type="submit" value="submit" />
          </div>
      </form>
            </>
        )
    }
}
